<script>
import * as PIXI from 'pixi.js'
import NEAT from 'neataptic'
import * as Chart from 'chart.js'
const Simulation = require('thesis-simulation').default

function initChart () {
  let chartCanvas = document.getElementById('chart').getContext('2d')
  let chart = new Chart(chartCanvas, {
    type: 'line',
    data: {
      labels: [],
      datasets: [{
        label: 'fitness',
        data: []
      }]
    },
    options: {
      animation: false
    }
  })
  return chart
}

export default {
  name: 'Player',
  mounted: function () {
    PIXI.loader
      .add('./static/chassis.png')
      .add('./static/wheel.png')
      .load()
    this.chart = initChart()
    this.simulation = new Simulation(60, document.getElementById('player'), PIXI.loader)
    let t = this
    let running = false
    let i = 0
    document.getElementById('playButton').onclick = function () {
      running = true
      let json = JSON.parse(document.getElementById('jsonInput').value)
      let genome = NEAT.Network.fromJSON(json)
      t.simulation.evaluate(genome, json.piece).then(function () {
        running = false
        i = 0
      })
      t.chart.data.datasets[0].data = []
      t.chart.data.labels = []
    }
    function update () {
      if (!running) return
      i += 1
      t.simulation.update(1 / 60.0)
      if (i % 60 === 0) {
        t.chart.data.datasets[0].data.push(t.simulation.car.getComponent('car').fitness)
        t.chart.data.labels.push(t.chart.data.datasets[0].data.length)
        t.chart.update()
      }
    }
    setInterval(update, 16)
  }
}
</script>

